import React,{Component} from 'react';

class NameList extends Component {
         render(){
         	let time = this.props.time
         	console.log(time.toString().slice(time.toString().length - 2))
         	
         	time = parseInt(time)
          return (  
        
              <div>
              clas{time < 10 ? '0' + time : time.toString().slice(time.toString().length - 2)}
              </div>
        )
    
}
}	
export default NameList
